<strong>proced-string-lessp</strong> is a compiled Lisp function in `<code>proced.el</code>'.</br>
</br>
(proced-string-lessp <u>S1</u> <u>S2</u>)</br>
</br>
Return t if string <u>S1</u> is less than <u>S2</u> in lexicographic order.</br>
Return `equal' if <u>S1</u> and <u>S2</u> have identical contents.</br>
Return nil otherwise.
